function Detail() {
  const {name, image, platforms, released, rating, genres, description} = useSelector((state) => state.videogameDetail);

  return ( <div>
    <h1>{name}</h1>
    <img src={image} alt={name}/>
    <div>{platforms.map((plat, i) => {
      <div key={i}> </div>
    })}</div>
    </div> );
}

export default Detail;
